INSERT INTO `c4_template` VALUES (1,'mailNewPassword','Your New Password','\r\n    <p>\r\n    {FIRSTNAME}  {LASTNAME}    \r\n    </p>\r\n    \r\n    <p>\r\n    Your New Password\r\n    </p>    \r\n    \r\n    <p>\r\n    {PASSWORD}\r\n    </p>\r\n    \r\n    <p>\r\n         Go To Login Page\r\n        <br>\r\n        <a href=\"{LINK}\">{LINK}</a>\r\n    </p>\r\n    \r\n    <p>\r\n    Thank you,\r\n    </p>\r\n	\r\n\r\n\r\n','','en','New Password Email Template','{FIRSTNAME}  {LASTNAME}  {PASSWORD}  {LINK}  {+ siteURL +} ',1,'2019-05-31 17:58:22','2020-02-21 02:57:47',NULL),(2,'mailNewPassword','Yeni ireniz','<p> Merhaba {FIRSTNAME}  {LASTNAME} </p>\r\n<p>Yeni ifreniz</p>    \r\n<p>{PASSWORD}</p>\r\n<p>Sistemi Giri Yapmak in Aadaki Linki Kullanabilirsiniz\r\n<br>\r\n</p><p><a href=\"{LINK}\">Sisteme Giri</a>\r\n<br>   \r\n</p>\r\n<p>Teekkrler\r\n</p>','','tr','ifre Yenilendiinde, Bu Mail ifre Bilgisi Olarak Gnderilir.','{FIRSTNAME}  {LASTNAME}  {PASSWORD}  {LINK}  {+ siteURL +} ',1,'2019-07-16 22:54:24','2020-02-21 02:59:05',NULL),(3,'mailResetPassword','Reset Your Password','<p>\r\n\r\n\r\n\r\n\r\n    \r\n    <p>\r\n    {FIRSTNAME}  {LASTNAME}\r\n    </p>\r\n    \r\n    <p>\r\n    To complete the phase of resetting your account password, you will need to go to the URL below in your web browser.\r\n    </p>\r\n    \r\n    <p>\r\n    <a href=\"{LINK}\">RESET PASSWORD</a>\r\n    </p>\r\n    \r\n    <p></p>\r\n    If the above link does not work correctly, go to\r\n    <p></p>\r\n    \r\n    <p></p>\r\n    {LINK}</p><p>\r\n    <p></p>\r\n    \r\n    <p></p>\r\n    Thank you<p></p>\r\n\r\n</p>','','en','Password Resert Link  Email Template','{FIRSTNAME} {LASTNAME} {CODE} {LINK}',1,'2019-05-31 17:58:55','2020-02-21 02:56:48',NULL),(4,'mailResetPassword','ifre Yenileme Linki','<p>\r\n    {FIRSTNAME}  {LASTNAME}\r\n    </p>\r\n    \r\n    <p>\r\n	ifrenizi yenileyebilmeniz iin, aadaki linke tklaynz.\r\n	</p>\r\n	<p>\r\n	Sonrasnda ifreniz eposta adresnize gnderilecek.\r\n	</p>\r\n    \r\n    <p>\r\n    <a href=\"{LINK}\">ifremi Yenile</a>\r\n    </p>\r\n    \r\n    <p></p>\r\n    Yukardaki balant almadysa aadaki linki kopyalayp taraycnzda almasn salaynz.\r\n    <p></p>\r\n    \r\n    <p></p>\r\n    {LINK}\r\n    <p></p>\r\n    \r\n    <p></p>\r\n    Teekkr ederiz,\r\n    <p></p>','','tr','ifre yenilene istei gnderildiinde bu eposta ablonu gnderilir','{FIRSTNAME} {LASTNAME} {CODE} {LINK}',1,'2019-07-16 22:58:05','2019-07-17 03:04:11',NULL),(5,'mailPaymentFormCompleted','Thank you for your payment','<p>{FIRST_NAME} {LAST_NAME}</p><p>Thank you for your payment</p><p>Product Info:</p><p>{AMOUNT} {CURRENCY}</p><p>{PRODUCT_NAME}</p>','','en','After Payment Form Completed. Not subscription..','{AMOUNT}, {CURRENCY}, {FIRST_NAME}, {LAST_NAME}, {QUANTITY}, {PRODUCT_NAME}\r\n{PAYMENT_METHOD}\r\n{PAY_REF_NO} {VAT_RATE}\r\n',1,'2020-01-30 00:00:00','2020-02-22 05:04:33',NULL),(6,'mailPaymentFormCompleted','deme iin teekkr ederiz.','<p>Sayn {FIRST_NAME} {LAST_NAME}\r\n</p>\r\n<p>\r\ndeme Yaptnz in Teekkr ederiz.\r\n</p>\r\n<p>\r\ndeme Bilgileriniz.:</p>\r\n\r\n<p>{AMOUNT} {CURRENCY}</p>\r\n\r\n<p>{PRODUCT_NAME}</p>','','tr','After Payment Form Completed. Not subscription..','{AMOUNT}, {CURRENCY}, {FIRST_NAME}, {LAST_NAME}, {QUANTITY}, {PRODUCT_NAME}\r\n{PAYMENT_METHOD}\r\n{PAY_REF_NO} {VAT_RATE}\r\n',1,'2020-02-18 06:52:09','2020-02-21 03:01:54',NULL),(7,'mailNewRegister','Welcome To Crud4','    <p>\r\n    {FIRSTNAME}  {LASTNAME}    \r\n    </p>\r\n    \r\n    <p>\r\n    Your Password\r\n    </p>    \r\n    \r\n    <p>\r\n    {PASSWORD}\r\n    </p>\r\n    \r\n    <p>\r\n         Go To Login Page\r\n        <br>\r\n        <a href=\"{LINK}\">{LINK}</a>\r\n    </p>\r\n    \r\n    <p>Thank you</p>\r\n    \r\n','','en','New Registration Email','{FIRSTNAME}  {LASTNAME}  {PASSWORD}  {LINK}  {+ siteURL +} ',1,'2020-02-16 04:10:10','2020-02-21 03:00:00',NULL),(8,'mailNewRegister','Hogeldiniz','<p>\r\n    {FIRSTNAME}  {LASTNAME}    \r\n    </p>\r\n    \r\n    <p>\r\n    ifreniz</p>    \r\n    \r\n    <p>{PASSWORD}</p>\r\n    \r\n    <p>Sisteme Giri Yapmak in Tklaynz</p><p>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br>\r\n        <a href=\"{LINK}\">{LINK}</a>\r\n    </p>\r\n    \r\n    <p>Teekkr ederiz.</p>\r\n    \r\n\r\n','','tr','Yeni Kayt Maili','{FIRSTNAME}  {LASTNAME}  {PASSWORD}  {LINK}  {+ siteURL +} ',1,'2020-02-16 04:14:08','2020-02-22 04:56:12',NULL),(9,'mailSubscriptionPaymentCompleted','Thank you for your subscription payment','<p>&nbsp;{FIRST_NAME} {LAST_NAME}</p><p>We have recived your subscription payment<br><br>{PRODUCT_NAME}</p><p>{AMOUNT} {CURRENCY}</p><p>Your subscription will expire in {NEW_DUE_DATE}</p><p>Thank you</p>','','en','After subscription payment completed.','{AMOUNT}, {CURRENCY}, {FIRST_NAME}, {LAST_NAME}, {QUANTITY}, {PRODUCT_NAME}  {NEW_DUE_DATE}\r\n{PAYMENT_METHOD}\r\n{PAY_REF_NO} {VAT_RATE} {PAYMENT_ID}\r\n',1,'2020-02-19 12:00:57','2020-04-21 09:21:08',NULL),(10,'mailSubscriptionPaymentCompleted','deme Yaptnz iin teekkr ederiz.','<p>&nbsp;{FIRST_NAME} {LAST_NAME}</p><p>yelik demeniz iin teekkr ederiz<br><br>{PRODUCT_NAME}</p><p>{AMOUNT} {CURRENCY}</p><p>Aboneliiniz {NEW_DUE_DATE} tarihinde sona erecektir.</p><p>Teekkr ederiz</p>','','tr','After subscription payment completed.','{AMOUNT}, {CURRENCY}, {FIRST_NAME}, {LAST_NAME}, {QUANTITY}, {PRODUCT_NAME}  {NEW_DUE_DATE}\r\n{PAYMENT_METHOD}\r\n{PAY_REF_NO} {VAT_RATE} {PAYMENT_ID}\r\n',1,'2020-02-20 01:56:21','2020-04-21 09:21:56',NULL),(13,'termsOfService','Terms of Use','Preparing...','','en','Terms Of Service','{panelTitle} {baseURL} {companyName}',1,'2020-05-20 18:56:51','2020-05-20 19:32:37',NULL),(14,'termsOfService','Kullanc Szlemesi','Hazrlanyor.','','tr','Kullanc Szlemesi','{panelTitle} {baseURL} {companyName}',1,'2020-05-20 19:01:03','2020-05-20 19:32:47',NULL);
